    constructor(props){
        super(props)
        this.state = {
          result: 'No result',
        }
    
        this.handleScan = this.handleScan.bind(this)
      }
      handleScan(data){
        this.setState({
          result: data,
        })
      }
      handleError(err){
        console.error(err)
      }
      render(){
    
        return(
          <div>
            <BarcodeReader
              onError={this.handleError}
              onScan={this.handleScan}
              />
            <p>{this.state.result}</p>
          </div>
        )
      }
